  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains baseline tangent
  lines and bay closing lines in ESRI Arc/Info export and Arc/View shape file formats
  for the BOEM Pacific Region. Baseline tangent lines and bay closing lines are used
  by the BOEM to calculate the Submerged Lands Act (SLA) boundary line and the Limit
  of 8(g) Zone boundary line. These lines may also be used to calculate other offshore
  boundary lines. A second file containing baseline points is also available.\",\n\t\"license_title\":
